import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getDetail } from "../../Redux/actions";

const Detail = ({id})=>{


    const dispatch = useDispatch();

    useEffect(()=>{
      dispatch(getDetail())
    },[dispatch])
    return(
        <>
        <h1>Esta es la vista del Detail</h1>
        </>
    )
}

export default Detail;
